# 从文书网 jsfuck 中获取 key 的函数
# 该代码有大部分是目前我对 jsfuck 以纯python解密的思路

import re

def _wenshu_unjsfunk_my(string):
    # 我个人最开始考虑的处理方式，耦合性很高
    q = [
        ["!![]", "true"],
        ["![]", "false"],
        ["[][[]]", "undefined"],
        ["+[![]]", "NaN"],
        ["[]+[]", "\"\""],
        ["+[]", "0"],
        ["+!+[]", "1"],
        ["!+[]+!+[]", "2"],
        ["[+!+[]]+[+[]]", "10"]
    ]
    s = string
    for i in range(10):
        for a,b in q:
            s = s.replace(a,b)
    d = re.findall(r'(?:\+!0)+', s)
    for i in d:
        s = re.sub(r'(?:\+!0)+', str(i.count('+!0')), s, 1)
    # 这里是针对文书网 hidescript 的前置处理
    hs = ''.join(map(lambda i:chr(int(i)),re.findall(r'fromCharCode\(([^\)]+)\)', s)[0].split(',')))
    for idx,i in enumerate(hs):
        s = s.replace('$hidescript[{}]'.format(idx), repr(i))
        s = s.replace('$hidescript[({})]'.format(idx), repr(i))
    s = s.replace('(true0)', '"true"')
    s = s.replace('(false0)', '"false"')
    s = s.replace('!01', '2')
    s = s.replace('!02', '3')
    s = s.replace('""+undefined', '"undefined"')
    s = s.replace('""+{}', '"[object Object]"')
    s = s.replace('[false]+{}', '"false[object Object]"')
    s = s.replace('[true]+{}', '"true[object Object]"')
    s = s.replace('1+[0]','10')
    # 以下是针对文书网加密的的专门解密处理
    s = s.split("""'"'""")[1].strip('+')
    p = r'"([^"]+)"\+"([^"]+)"'
    for i in range(10):
        d = re.findall(p, s)
        for a,b in d:
            s = re.sub(p, '"{}"'.format(a+b), s, 1)
    s = re.sub(r'\(("[^"]+")\)',r'\1',s)
    p = r'("([^"]+)"\[([^\[\]]+)\])'
    d = re.findall(p, s)
    for i in d:
        a, b, c   = i
        try:    s = re.sub(p, repr(b[int(c)]), s, 1)
        except: s = re.sub(p, a, s, 1)
    s = s.replace("'",'')
    s = s.replace('+','')
    return s


def _wenshu_unjsfunk(string):
    # 受到别人代码启发的新的解析方式，这样更可能会解决通用jsfunck解析的方式
    # 之前由于我司框架问题不能用 eval 函数，所以没深究带有 eval 这种处理方式
    # 感谢作者的启发：https://github.com/songguoxiong/wenshu_utils/blob/master/wenshu_utils/docid/runeval.py
    # 后续发觉到，直接映射的方式并不能处理通解类型的数据，所以以下的处理实际上还是存在一定可能不通过，不过代码确实足够简洁。
    # 后续还是考虑写一个对于 js 来说更加通解的处理方式
    q = [
        ['!+[]', '1'],
        ['!![]', '"true"'],
        ['![]', '"false"'],
        ['("true"+[])', '"true"'],
        ['("false"+[])','"false"'],
        ['[+[]]', '[0]'],
        ['(+[])', '0'],
        ['[][[]]', '"undefined"'],
        ['[]+[]', '""'],
        ['""+{}', '"[object Object]"'],
        ['["false"]+{}', '"false[object Object]"'],
        ['+1+[0]', '10'],
        ['+{}+""', '"NaN"'],
        ['["false"]', '"false"'],
    ]
    s = string
    for a, b in q: s = s.replace(a, b)
    # 后续是针对文书网的处理
    h = ''.join(map(lambda i:chr(eval(i)),re.findall(r'fromCharCode\(([^\)]+)\)', s)[0].split(',')))
    s = s.split(';_[_][_]')[-1][:-3]
    s = s.replace('$hidescript', repr(h))
    return re.findall('_KEY="([^"]+)";', eval(s))[0]

